CREATE TABLE countries
( id INT NOT NULL,   
  code VARCHAR2(10 CHAR) NOT NULL,
  name VARCHAR2(255 CHAR) NOT NULL,  
  national_currency VARCHAR2(20 CHAR) DEFAULT 'USD' NOT NULL,
  CONSTRAINT countries_pk PRIMARY KEY (id)  
);

CREATE SEQUENCE countries_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;

CREATE TABLE states
( id INT NOT NULL,   
  country_id INT NOT NULL,
  code VARCHAR2(10 CHAR) NOT NULL,
  name VARCHAR2(255 CHAR) NOT NULL,    
  CONSTRAINT states_pk PRIMARY KEY (id),
  CONSTRAINT fk_country_id FOREIGN KEY (country_id) REFERENCES countries(id)
);

CREATE SEQUENCE states_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;

CREATE TABLE cities
( id INT NOT NULL,   
  state_id INT NOT NULL,
  code VARCHAR2(10 CHAR) NOT NULL,
  name VARCHAR2(255 CHAR) NOT NULL,  
  value_per_kilometer NUMBER(16,6) NOT NULL,
  value_per_minute NUMBER(16,6) NOT NULL,
  value_base_rate NUMBER(16,6) NOT NULL,
  CONSTRAINT cities_pk PRIMARY KEY (id),
  CONSTRAINT fk_state_id FOREIGN KEY (state_id) REFERENCES states(id)
);

CREATE SEQUENCE cities_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;

CREATE TABLE users
( id INT NOT NULL, 
  user_type VARCHAR2(50 CHAR) NOT NULL,  
  tributary_id_type VARCHAR2(10 CHAR) NOT NULL,
  tributary_id VARCHAR2(30 CHAR) NOT NULL,  
  name VARCHAR2(255 CHAR) NOT NULL,  
  last_name VARCHAR2(255 CHAR) NOT NULL,  
  phone_number VARCHAR2(30 CHAR) NOT NULL, 
  profile_photho VARCHAR2(255 CHAR),  
  location INT NOT NULL,
  language VARCHAR2(50 CHAR) NOT NULL,    
  CONSTRAINT users_pk PRIMARY KEY (id),
  CONSTRAINT fk_location FOREIGN KEY (location) REFERENCES cities(id)
);

CREATE UNIQUE INDEX users_idx
  ON users (tributary_id);

CREATE SEQUENCE users_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;

CREATE TABLE payment_methods_types
( id INT NOT NULL,       
  name VARCHAR2(255 CHAR) NOT NULL,    
  CONSTRAINT payment_methods_types_pk PRIMARY KEY (id)  
);

CREATE SEQUENCE payment_methods_types_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;

CREATE TABLE user_payment_methods
( id INT NOT NULL,   
  user_id INT NOT NULL,
  payment_method_type INT NOT NULL,  
  payment_information VARCHAR2(255 CHAR) NOT NULL,    
  name VARCHAR2(255 CHAR) NOT NULL,
  business_account VARCHAR2(1 CHAR) DEFAULT 'N' NOT NULL,
  company_name VARCHAR2(255 CHAR),
  CONSTRAINT user_payment_methods_pk PRIMARY KEY (id),
  CONSTRAINT fk_pmt_user_id FOREIGN KEY (user_id) REFERENCES users(id),
  CONSTRAINT fk_pmt_payment_method_type FOREIGN KEY (payment_method_type) REFERENCES payment_methods_types(id)  
);

CREATE SEQUENCE user_payment_methods_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE user_emails
( id INT NOT NULL,   
  user_id INT NOT NULL,    
  email VARCHAR2(255 CHAR) NOT NULL,     
  user_payment_method_id INT NOT NULL,  
  CONSTRAINT user_emails_pk PRIMARY KEY (id),
  CONSTRAINT fk_ue_user_id FOREIGN KEY (user_id) REFERENCES users(id),  
  CONSTRAINT fk_ue_user_payment_method_id FOREIGN KEY (user_payment_method_id) REFERENCES user_payment_methods(id)  
);

CREATE SEQUENCE user_emails_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE vehichles
( id INT NOT NULL,     
  vehichle_plate VARCHAR2(20 CHAR) NOT NULL,  
  brand VARCHAR2(255 CHAR) NOT NULL,  
  model VARCHAR2(255 CHAR) NOT NULL,  
  year INT NOT NULL,  
  service VARCHAR2(255 CHAR) NOT NULL,  
  CONSTRAINT vehichles_pk PRIMARY KEY (id)  
);

CREATE UNIQUE INDEX vehichles_idx
  ON vehichles (vehichle_plate);

CREATE SEQUENCE vehichles_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE driver_vehichles
( id INT NOT NULL,   
  user_id INT NOT NULL,    
  vehichle_id INT NOT NULL,  
  payment_account VARCHAR2(255 CHAR) NOT NULL,
  CONSTRAINT driver_vehiches_pk PRIMARY KEY (id),
  CONSTRAINT fk_dv_user_id FOREIGN KEY (user_id) REFERENCES users(id),
  CONSTRAINT fk_dv_vehichle_id FOREIGN KEY (vehichle_id) REFERENCES vehichles(id)
);

CREATE SEQUENCE driver_vehichles_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE trips
( id INT NOT NULL,  
  pickup DATE NOT NULL, 
  user_id INT NOT NULL,
  driver_id INT NOT NULL,
  origin_address VARCHAR2(255 CHAR) NOT NULL,
  destination_address VARCHAR2(255 CHAR) NOT NULL,
  payment_method INT NOT NULL,
  trip_fare NUMBER(16,6) DEFAULT 0 NOT NULL,  
  trip_status VARCHAR2(20 CHAR) DEFAULT 'ACTVE' NOT NULL, -- ACTIVE, FINISHED, CANCELED  
  dinamic_fare VARCHAR2(1 CHAR) DEFAULT 'N' NOT NULL,
  CONSTRAINT trips_pk PRIMARY KEY (id),
  CONSTRAINT fk_tr_user_id FOREIGN KEY (user_id) REFERENCES users(id),
  CONSTRAINT fk_tr_driver_id FOREIGN KEY (driver_id) REFERENCES driver_vehichles(id),
  CONSTRAINT fk_tr_payment_method FOREIGN KEY (payment_method) REFERENCES user_payment_methods(id)
);

CREATE SEQUENCE trips_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE trip_concepts
( id INT NOT NULL,   
  trip_id INT NOT NULL,
  concept_name VARCHAR2(255 CHAR) NOT NULL,
  concept_value NUMBER(16,6),
  type_concept_use VARCHAR2(255 CHAR) NOT NULL,     -- INCEMENTO, DECREMENTO   
  type_concept_value VARCHAR2(255 CHAR) NOT NULL,   -- PORCENTAJE, VALOR  
  concept_description VARCHAR2(400 CHAR),
  CONSTRAINT trip_concepts_pk PRIMARY KEY (id),
  CONSTRAINT fk_tc_trip_id FOREIGN KEY (trip_id) REFERENCES trips(id)   
);

CREATE SEQUENCE trip_concepts_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE trip_coordinates
( id INT NOT NULL,   
  trip_id INT NOT NULL,
  date_time TIMESTAMP NOT NULL,
  latitude VARCHAR2(50) NOT NULL,
  longitude VARCHAR2(50) NOT NULL,  
  CONSTRAINT trip_coordinates_pk PRIMARY KEY (id),
  CONSTRAINT fk_tripc_trip_id FOREIGN KEY (trip_id) REFERENCES trips(id)  
);

CREATE SEQUENCE trip_coordinates_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;


CREATE TABLE driver_consignations
( id INT NOT NULL,   
  driver_vehichle_id INT NOT NULL,
  consignation_date TIMESTAMP NOT NULL,
  value NUMBER(16,6) NOT NULL,
  consignation_account INT NOT NULL, 
  CONSTRAINT driver_consignations_pk PRIMARY KEY (id),
  CONSTRAINT fk_dc_driver_vehichle_id FOREIGN KEY (driver_vehichle_id) REFERENCES driver_vehichles(id)  
);

CREATE SEQUENCE driver_consignations_seq
MINVALUE 0
START WITH 0
INCREMENT BY 1
NOCYCLE;



